struct waitNode
{
    // char *oriStr; //=malloc()
    char *curStr; //initial set to oriStr;
    struct waitNode *next;
};
int numMatchingSubseq(char *s, char **words, int wordsSize)
{
    int i = 0;
    int result = 0;
    struct waitNode **waitlist = (struct waitNode **)calloc(26, sizeof(struct waitNode *));
    struct waitNode *batchNodes = (struct waitNode *)malloc(sizeof(struct waitNode) * wordsSize);

    for (i = 0; i < wordsSize; i++)
    {
        //construct waitNode and add to waitlist;
        struct waitNode *tmp = batchNodes + i;

        char *word = words[i];
        // tmp->oriStr = word;
        tmp->curStr = word;
        tmp->next = waitlist[word[0] - 'a'];
        waitlist[word[0] - 'a'] = tmp;
    }
    for (i = 0; s[i]; i++)
    {
        struct waitNode *curNode = waitlist[s[i] - 'a'];
        struct waitNode *nextNode = NULL;
        waitlist[s[i] - 'a'] = NULL;
        while (curNode)
        {
            nextNode = curNode->next;
            curNode->curStr++;
            if (*(curNode->curStr) == 0)
            {
                result++;
            }
            else
            {
                curNode->next = waitlist[curNode->curStr[0] - 'a'];
                waitlist[curNode->curStr[0] - 'a'] = curNode;
            }

            curNode = nextNode;
        }
    }
    free(batchNodes);
    free(waitlist);

    //construct wait list
    return result;
}

